import React, { Component } from 'react';
import logo from '../logo.jpeg';

class Header extends Component {
    render() {
        return (
            <div className="header">
                <h1><a href=""><img src={logo} alt="FESTIVAL DE CANNES" /></a></h1>
                <ul className="year_list">
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                            }}
                        >ALL</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                            }}
                        >19</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                            }}
                        >18</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                            }}
                        >17</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                            }}
                        >16</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                            }}
                        >15</a>
                    </li>
                </ul>
            </div>
        );
    }
}

export default Header;
